import React from 'react'

const Header_for_mobile = () => {
  return (
   <div>
    <div className="w-full h-20 bg-gradient-to-r from-blue-400 to-blue-300 text-white flex items-center justify-center shadow-md text" style={{ fontFamily: 'Nunito Sans' }}>
        <h1>
            The Great Himalayas
        </h1>
    </div>
   </div>
  )
}

export default Header_for_mobile;
